import Patient_Entry from "./patient_display_item";


function Patient_display_grid({props}){
    const { posts } = props;
    console.log(posts)

    return (
        <div>
            <h1>patient grid</h1>
            <ul>
                {posts.map((post) => (
                    <Patient_Entry props={post}/>))}
            </ul>

        </div>)

}
export default Patient_display_grid
